Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(List(
      ("query1", 1614345600),
      ("query2", 1614345601),
      ("query3", 1614345602),
      ("query1", 1614345603),
      ("query4", 1614345604),
      ("query2", 1614345605),
      ("query5", 1614345606),
      ("query1", 1614345607),
      ("query2", 1614345608),
      ("query3", 1614345609),
      ("query4", 1614345610),
      ("query5", 1614345611)
    )).map(x => (x._1, x._2)).toJavaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.parallelize(List(
      "query1",
      "query2",
      "query3"
    )).toJavaRDD

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Calculate hit rate
    val hitRate = calculateHitRate(onsiteData, broadcastTopQueries)

    println(s"Hit rate: $hitRate")

    spark.stop()
  }

  def calculateHitRate(onsiteData: JavaRDD[(String, Long)], broadcastTopQueries: Broadcast[Array[String]]): Double = {
    val cache = mutable.Map[String, (Long, Boolean)]()
    val cacheMisses = ListBuffer[String]()

    onsiteData.foreachPartition { partition =>
      partition.foreach { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          if (!cache.contains(query) || (System.currentTimeMillis() - cache(query)._1) > 12 * 60 * 60 * 1000) {
            cacheMisses += query
            cache.put(query, (System.currentTimeMillis(), true))
          } else {
            cache(query) = (System.currentTimeMillis(), false)
          }
        }
      }
    }

    val totalQueries = onsiteData.count()
    val cacheHits = totalQueries - cacheMisses.size

    cacheHits.toDouble / totalQueries.toDouble
  }
}
```
This job first loads the onsite attributed data and top frequent queries. It then broadcasts the top frequent queries to all nodes in the cluster. The `calculateHitRate` function calculates the hit rate by iterating over the onsite attributed data and checking if the query is present in the top frequent queries. If it is, it checks if the query is in the cache and if it's not, it increments the cache misses counter and adds the query to the cache. If the query is in the cache, it updates the cache timestamp. Finally, it calculates the hit rate by dividing the number of cache hits by the total number of queries.

