To make Bootstrap tables sortable alphanumerically by clicking the headers without jQuery or other plugins, you can use plain JavaScript. Here's a simple example:

1. Add a click event listener to the table headers.
2. When a header is clicked, sort the table rows based on the corresponding column.

HTML:
```html
<table id="myTable" class="table">
  <thead>
    <tr>
      <th onclick="sortTable(0)">Name</th>
      <th onclick="sortTable(1)">Age</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>John</td>
      <td>25</td>
    </tr>
    <tr>
      <td>Jane</td>
      <td>30</td>
    </tr>
    <tr>
      <td>Doe</td>
      <td>20</td>
    </tr>
  </tbody>
</table>
```

JavaScript:
```javascript
function sortTable(n) {
  const table = document.getElementById("myTable");
  let rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
  switching = true;
  dir = "asc";

  while (switching) {
    switching = false;
    rows = table.rows;

    for (i = 1; i < (rows.length - 1); i++) {
      shouldSwitch = false;
      x = rows[i].getElementsByTagName("TD")[n];
      y = rows[i + 1].getElementsByTagName("TD")[n];

      if (dir === "asc") {
        if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
          shouldSwitch = true;
          break;
        }
      } else if (dir === "desc") {
        if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
          shouldSwitch = true;
          break;
        }
      }
    }

    if (shouldSwitch) {
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
      switchcount++;
    } else {
      if (switchcount === 0 && dir === "asc") {
        dir = "desc";
        switching = true;
      }
    }
  }
}
```

This code will sort the table rows alphanumerically when you click on the table headers. The `sortTable` function takes an argument `n` which is the index of the column to be sorted. The function sorts the rows in ascending order by default and switches to descending order when clicked again.

