Here is a JavaScript function that merges two arrays of objects based on the `stepId` and `fieldId` properties, and prioritizes the `message` property from the first object if it exists:

```javascript
function mergeArrays(arr1, arr2) {
  const mergedArray = [...arr1];

  arr2.forEach((obj2) => {
    const foundIndex = mergedArray.findIndex(
      (obj1) => obj1.stepId === obj2.stepId && obj1.fieldId === obj2.fieldId
    );

    if (foundIndex === -1) {
      mergedArray.push(obj2);
    } else {
      mergedArray[foundIndex].message =
        mergedArray[foundIndex].message || obj2.message;
    }
  });

  return mergedArray;
}

