function getElapsedTime(postTime: Date): string {
  const currentTime = new Date();
  const elapsedMilliseconds = currentTime.getTime() - postTime.getTime();

  const seconds = Math.floor((elapsedMilliseconds / 1000) % 60);
  const minutes = Math.floor((elapsedMilliseconds / (1000 * 60)) % 60);
  const hours = Math.floor((elapsedMilliseconds / (1000 * 60 * 60)) % 24);
  const days = Math.floor(elapsedMilliseconds / (1000 * 60 * 60 * 24));

  if (days > 0) {
    return `${days} day(s) ago`;
  } else if (hours > 0) {
    return `${hours} hour(s) ago`;
  } else if (minutes > 0) {
    return `${minutes} minute(s) ago`;
  } else {
    return `${seconds} second(s) ago`;
  }
}
```

This function takes a `Date` object as an argument, which represents the time when the post was made. It calculates the elapsed time in milliseconds since the post was made, and then converts this value into seconds, minutes, hours, and days.

The function then checks which unit of time is the largest (i.e., which one is greater than zero), and returns a string that represents the elapsed time in that unit, along with the word "ago".

